import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ({imageUrl, box}) => {
  const faceBoxs = box.map((ele, i) => {
    return (
      <div className='center ma'>
        <div className='absolute mt2'>
          <img id='inputimage' src={imageUrl} alt='' width='500px' height='auto'/>
          <div className='bounding-box' style={{top: ele.topRow, right: ele.rightCol, bottom: ele.bottomRow, left: ele.leftCol}}>
            <div className='bounding-box-concepts'>
              <div className='bounding-box__concept'>
                <span className="concept__name">{ele.face}</span>
                <span className="concept__prediction-val">{box.num}</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  })
}

export default FaceRecognition;
